import React from 'react'


function Content(props)
{

    return (
        <div className = "info">
            
        <div className ="info-card">
            <p><b>Question : {props.question}</b></p>
            <p>{props.punchline}</p>
        </div>
    
        </div>
    )
}
export default Content
